import './Home.css'; 
import Navbar from '../Components/Navbar';
import hero from '../Assets/hero.jpg';

function Home() {
  return (
    <>
    <Navbar/>
    <div className="container">
      <div className="title">
        <h1>Ari Creations</h1>
      </div>
      <div className="content">
        <div className="article">
          <h2>Hi Hello!</h2>
          <p>Welcome to Our Websites</p>
          <a href="#" className="button">Register Now</a>
        </div>
        <div className="jaanu">
          <img src={hero}alt="my website" />
        </div>
      </div>
    </div>
    <Footer/>
    </>
  );
}

export default Home;
